import { useEffect } from "react";
import { fetchComplaints } from "../../api/complaints.api";
import { useAuth } from "../../auth/AuthContext";

export default function Dashboard() {
  const { profile } = useAuth();

  const roleName =
    profile?.roles?.name || profile?.role || profile?.user_roles?.role || "USER";

  useEffect(() => {
    async function test() {
      try {
        const data = await fetchComplaints();
        console.log("‚úÖ Complaints fetched:", data);
      } catch (err) {
        console.error("‚ùå Complaints fetch failed:", err.message);
      }
    }
    test();
  }, []);

  return (
    <div style={{ padding: 10 }}>
      {/* Header */}
      <div style={{ marginBottom: 18 }}>
        <h2 style={{ margin: 0, fontSize: 26, fontWeight: 800 }}>
          üëã Welcome, {profile?.full_name || "User"}
        </h2>
        <p style={{ margin: "6px 0 0", color: "#666" }}>
          Role: <b>{roleName}</b> ‚Ä¢ Manage your apartment services smoothly.
        </p>
      </div>

      {/* Quick Stats */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(220px, 1fr))",
          gap: 14,
          marginBottom: 18,
        }}
      >
        <Card title="üìå Complaints" value="Track issues" subtitle="View & raise complaints" />
        <Card title="üßæ Maintenance" value="Invoices & payments" subtitle="Pay dues and view receipts" />
        <Card title="üì¶ Parcels" value="Gate updates" subtitle="Visitors and parcel tracking" />
        <Card title="üõí Marketplace" value="Buy & sell" subtitle="Order items inside community" />
      </div>

      {/* Main Section */}
      <div
        style={{
          background: "#fff",
          borderRadius: 14,
          padding: 18,
          border: "1px solid #eee",
          boxShadow: "0 6px 18px rgba(0,0,0,0.04)",
        }}
      >
        <h3 style={{ marginTop: 0, marginBottom: 8 }}>‚ú® Dashboard Overview</h3>
        <p style={{ margin: 0, color: "#666", lineHeight: 1.5 }}>
          This dashboard will later show live counts like pending complaints, unpaid invoices,
          upcoming events, facility bookings, and parcel alerts.
        </p>

        <div style={{ marginTop: 16, display: "flex", gap: 10, flexWrap: "wrap" }}>
          <button style={primaryBtn}>‚ûï Create Complaint</button>
          <button style={secondaryBtn}>üì¶ View Parcels</button>
          <button style={secondaryBtn}>üßæ Maintenance</button>
          <button style={secondaryBtn}>üõí Marketplace</button>
        </div>
      </div>
    </div>
  );
}

function Card({ title, value, subtitle }) {
  return (
    <div
      style={{
        background: "#fff",
        borderRadius: 14,
        padding: 16,
        border: "1px solid #eee",
        boxShadow: "0 6px 18px rgba(0,0,0,0.04)",
      }}
    >
      <div style={{ fontWeight: 800, marginBottom: 6 }}>{title}</div>
      <div style={{ fontSize: 16, fontWeight: 700 }}>{value}</div>
      <div style={{ fontSize: 13, color: "#777", marginTop: 6 }}>{subtitle}</div>
    </div>
  );
}

const primaryBtn = {
  padding: "10px 14px",
  borderRadius: 10,
  border: "none",
  background: "#2563eb",
  color: "#fff",
  fontWeight: 700,
  cursor: "pointer",
};

const secondaryBtn = {
  padding: "10px 14px",
  borderRadius: 10,
  border: "1px solid #e5e7eb",
  background: "#fff",
  color: "#111",
  fontWeight: 700,
  cursor: "pointer",
};
